import { useEffect, useState } from 'react';
import './Options.css'

function Options(props: any) {
    const [optionsState, setOptionsState] = useState([])

    useEffect(() => {
        fetch(`http://api.openweathermap.org/geo/1.0/direct?q=Markham&limit=5&appid=3289764f272a524f9cf22f194959aa13`) // Replace YOUR_API_KEY with your actual API key
          .then(res => res.json())
          .then(data => {
            setOptionsState(data); 
          })
          .catch(error => {
            console.error("Error fetching data:", error);
          });
      }, [props.formData.city, props.formData.country]);

    return (
        <ul>
        {Object.entries(optionsState).map(([key, value]) => (
          <li key={key}>
            <strong>{key}:</strong> {JSON.stringify(value)}
          </li>
        ))}
        <li>{optionsState[0]}</li>
      </ul>
    )
}

export default Options;
